import { IconCheck } from "../icons/IconCheck";
import { DeleteIcon } from "../icons/DeleteIcon";
function TodoItem({text,completed,onComplete,onDelete}) {
    return (
      <li className={`li_todos ${completed && "completd"}`}>
        {/* <span className={`span_accion completedItem`} onClick={onComplete}>
          <CheckIcon/>
        </span> */}
        <IconCheck
        completed={completed}
        onComplete={onComplete}
        />
        <p>{text}</p>
        <DeleteIcon
          onComplete={onDelete}
        />
        {/* <span className="span_accion deleteItem" onClick={onDelete}>X</span> */}
      </li>
    );
}


export {TodoItem};
